INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(1, ' In Mann Ki Baat, PM Modi Congratulates ''Sports Minister'' Sonowal', '2016-06-06', ' In his monthly radio address Mann ki Baat, Prime Minister Narendra Modi congratulated Sarbananda Sonowal, the Chief Minister designate of Assam, but in his capacity as the Union sports minister. Mr Sonowal, who will take oath on May 24, has quit PM Modi''s cabinet.\r\n\r\nPM Modi said he was pleased with the way Mr Sonowal did not neglect his duties as the sports minister even while the assembly elections in Assam was on.\r\n\r\nMr Sonowal, he said, had paid a surprise visit to Patiala''s National Institute of sports in the middle of the election season.\r\n\r\n"There were polls, he was a chief minister candidate but Sarbanand Sonowal performed his duty as a sports minister. This is a big thing," PM Modi said. "Everybody was surprised and noted how a Union Minister showed so much concern."\r\n\r\nThe BJP has won the recently held elections in Assam - a huge victory, since it was the party''s first in a north-eastern state. Mr Sonowal, who is from the state, had led the campaign. At the time, the 53-year-old had been the minister for sports and youth welfare in the Union Government.\r\n\r\nPM Modi said it was important to create the correct atmosphere to encourage athletes before the nation thought about the medal tally in the Olympics.\r\n\r\n"When we talk about the Olympics we do feel sad at the medal tally. But we need to create the right atmosphere to encourage athletes," he said. "It is essential to be positive about our athletes. Let us ot worry about the results."\r\n\r\nIn this context, he spoke of academic results also, referring to a letter written to him by a student named Gaurav.\r\n\r\nThe student from Madhya Pradesh had written to say that he had scored 89% but his family was not satisfied with his results, since they wished him to score 90%.\r\n\r\n"Gaurav, I have read your letter and I am sure there are many like you out there," PM Modi said. Appealing to parents to encourage their wards, he said it was important to feel positivity. \r\n', , '5.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(2, '''Where Did They Get Dawood''s Number?'' Minister Eknath Khadse Asks AAP', '2016-06-07', ' Maharashtra Minister Eknath Khadse has rubbished the charges of having received calls from underworld don Dawood Ibrahim as "baseless".\r\n\r\nResponding to charges by a hacker and the Aam Aadmi Party, Mr Khadse said, "The charges are completely baseless. My questions is, how did they find out Dawood''s number? If they have found his number, they should have gone to the police."\r\n\r\nMr Khadse said he has a written statement from his cellphone carrier stating he has not received any international calls in the last one year.\r\n\r\nThe Police also backed the minister''s claim. "Our initial analysis of the cellphone records indicated there have been neither incoming nor outgoing calls on the minister''s number to that of the fugitive (Dawood) during the entire period of September 2015 to April 2016," senior police officer Atul Chandra Kulkarni said.\r\n\r\nCiting a sensational scoop by an ''ethical hacker'' Manish Bhangale, the Aam Aadmi Party had demanded Mr Khadse''s resignation alleging calls were made from Dawood Ibrahim''s residence in Karachi to his mobile phone.\r\n\r\n"Eknath Khadse lied about his phone being out of service. His number received several calls from Dawood Ibrahim''s wife Mehjabeen Shaikh''s number between September 4 2015 to April 5, 2016," AAP spokesperson Preeti Sharma Menon claimed in a press conference in Mumbai.\r\n\r\nShe also accused the minister of interfering in the investigation and said she met Chief Minister Devendra Fadnavis to raise the issue. "I wrote to Chief Minister Devendra Fadnavis demanding a fair investigation as this is a very serious charge concerning national security," she said.\r\n\r\nMr Bhangale has said he first went to Dubai and got Dawood''s wife Mehjabeen''s number, hacked it and placed a call details request on her behalf to Pakistan Telecommunication Company Limited (PTCL).\r\n', , '4.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(4, 'BJP''s Roopa Ganguly Attacked, Allegedly By Trinamool Workers Near Kolkata', '2016-06-07', 'KOLKATA:  Actor and BJP leader Roopa Ganguly''s convoy was attacked in Diamond Harbour near Kolkata today, allegedly by members of the ruling Trinamool Congress.  \n\nMs Ganguly, who suffered head injuries, was admitted to the district hospital.\n\nThe attack took place while Ms Ganguly was returning from South 24 Parganas.\n\nRoopa Ganguly had unsuccessfully contested from Howrah (North) against Trinamool''s Laxmi Ratan Shukla in the recent assembly elections in Bengal.\n ', , '2,jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(5, 'Bolt bothered by hamstring, says coach', '2016-06-07', 'Olympic sprint champion Usain Bolt received treatment for "slight discomfort" in his hamstring following his 100 metres victory in Saturday''s Cayman Invitational, his coach Glen Mills said on Monday.\r\n\r\nBolt, who is scheduled to run the 100m at the Golden Spike IAAF World Challenge in Ostrava, Czech Republic on Friday, travelled to Germany after posting 10.05 seconds in his season opener and had treatment there, said Mills.\r\n\r\nBolt is targeting an unprecedented Olympic threepeat at the Rio de Janeiro Games in August where he will be defending his 100, 200 and 4x100 relay titles.\r\n\r\n"I think he has a slight discomfort in his hamstring, so he didn’t bother push it after that, but he’ll be alright," Mills told Jamaican radio station Hitz 92fm. "He’s in Germany as we speak and the doctors say he will be fine."\r\n\r\nBolt, the 100 and 200 world record holder, got off to a moderate start in his season-opening race before stepping away from the field in the last 60 metres and cruising to the tape.\r\n\r\nHe later told reporters he was a bit rusty but would be ready for Jamaica’s Olympic trials from June 30 to July 3 in Kingston.\r\n\r\n"If you saw the race, you could see he was grimacing a bit," said Mills, who has guided Bolt to six gold medals at the last two Olympics. "(I) didn’t think he was under any pressure, but he was just grimacing because he wanted to really push it, but he was just grimacing that he couldn’t get the chance to do so."\r\n', , '2.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(6, 'Brazil''s Temer tells Olympic committee Rio will be ready', '2016-06-08', 'Interim President Michel Temer told the International Olympic Committee that Brazil''s change of government has not interrupted preparations for the Rio 2016 Games, newly appointed Sports Minister Leonardo Picciani said on Monday.\r\n\r\nTemer spoke to IOC president Thomas Bach by telephone and assured him the games will take place as planned, Picciani told reporters after a meeting with Brazil''s new president, who replaced suspended President Dilma Rousseff on Thursday.\r\n\r\nPicciani, a young politician from Rio, said preparations for the global sports event were on schedule and security for the games was guaranteed, playing down differences with the new Defense Minister Raul Jungmann.\r\n\r\nJungmann told the Estado de S.Paulo newspaper over the weekend he was worried about security provisions for foreign dignitaries and the failure of foreign intelligence agencies to cooperated with Brazil on potential terrorist attacks.\r\n\r\nPicciani said the differences were overcome in the meeting with Temer. "There are issues that have to be resolved, but they are provided for within the government plan," Picciani said.\r\n\r\nThe Defense Ministry will deploy 38,000 troops for security during the Olympics to back 47,000 police and civil defence personnel in Rio de Janeiro.\r\n\r\nPolitical turmoil over Rousseff''s impeachment, the risk of crime and an outbreak of the Zika virus have threatened to keep visitors away from the games that kick off on August 5.\r\n', , '1.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(7, 'Certain people with depression may benefit from exercise', '2016-06-06', 'Exercise can help people with certain genetic traits lower depressive symptoms more, says a new study.\r\n\r\nThe researchers believe that in the future, it is possible that blood or saliva could be tested to determine if a person could benefit from physical activity to lower depressive symptoms.\r\n\r\nThe researchers found that men who were carriers of two specific genes had the most significant response to exercise.\r\n\r\nThe results suggest physical activity as part of a treatment plan -- exercise as moderate as walking -- could help the carriers of these genes.\r\n\r\n"I want to better understand who could benefit most from physical activity. I''d like to take the same approach to exercise that we take to medication, which is to have a personalised medicine approach," said the study''s first author Vonetta Dotson, assistant professor at the University of Florida in the US.\r\n\r\n"If we show through systematic research that exercise has a good chance of helping a patient because of their particular characteristics, I think that might help with patients'' motivation to exercise," Dotson noted.\r\n\r\nThe study used data gathered in the Lifestyle Interventions and Independence for Elders, or LIFE, pilot study.\r\n\r\nDuring the LIFE pilot study, 396 sedentary older adults were separated into two groups: those who received health education classes and those who were given moderate physical activity classes for 12 months.\r\n\r\nThe participants also underwent genetic testing before the intervention, and the researchers tested three genes -- the brain-derived neurotrophic, or BDNF, gene, a serotonin transporter gene and a gene called apolipoprotein E.\r\n\r\nThe researchers found the greatest decrease in symptoms such as loss of appetite and concentration difficulties in men who carried the BDNF genetic variation that predisposed them to depression.', , '4.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(8, 'China breaks Cultural Revolution silence', '2016-06-08', 'China''s state-run media has said the country can never allow a repeat of the "error" of the Cultural Revolution.\r\n\r\nThe editorial in Communist Party mouthpiece the People''s Daily is the first official comment following Monday''s 50th anniversary of the start of the unrest.\r\n\r\nThe campaign to "purge" society of Mao Zedong''s political opponents ushered in years of bloodshed and turmoil.\r\n\r\nThe era was "entirely wrong in both theory and practice", the paper said.\r\n\r\nChina''s ruling Communist Party has consistently restricted open discussion of the Cultural Revolution era, fearing it could undermine its legitimacy and public confidence in its leadership.\r\n\r\nBut it has previously also acknowledged that the Maoist policies of the era were flawed.\r\n\r\nWhat was the Cultural Revolution?\r\n\r\nThe Cultural Revolution was a campaign launched by Chinese leader Mao Zedong in 1966 to purge his rivals in the ruling Communist Party. It ended up destroying much of China''s social fabric.\r\n\r\nWhat happened during it?\r\n\r\nChairman Mao gave licence to Chinese youth to destroy the so-called four "olds" or perceived enemies of Chinese culture: customs, habits, culture and thinking. In the early years, a chaotic kind of youth "tyranny" prevailed which saw schools and temples destroyed. Children turned on their parents and students turned on their teachers, intellectuals were exiled. Thousands were beaten to death or driven to suicide. Mao also encouraged a personality cult around himself, which led to people almost worshipping his writings and image.\r\n\r\nHow long did it last?\r\n\r\nIt officially ended only with Mao''s death in 1976. Millions were denounced and punished during this time, but there are varying estimates as to how many people actually died.\r\n\r\nThe main state media outlets had made virtually no mention of the anniversary on Monday. Only Hong Kong media, which enjoy greater freedoms than their counterparts on their mainland, gave coverage to the anniversary.\r\n\r\nNo official events were planned by the Chinese authorities to mark day, but it was being widely discussed on social media.\r\n\r\nThe People''s Daily''s editorial said the Communist Party had "long taken a solemn attitude toward bravely admitting, correctly analysing and firmly correcting the mistakes of our leadership figures".\r\n\r\nIt also said the 1981 resolution by the Party to condemn the revolution was "unshakeably scientific and authoritative".\r\n\r\n"History always develops in a forward direction. We sum up and absorb lessons from history in order to learn from it and better move forward ourselves."\r\n\r\nBoth People''s Daily and the state-run Global Times also ran an editorial in English under the headline "Society firmly rejects Cultural Revolution", noting that discussion of the day had been "emerging on the internet".\r\n\r\nThe paper said the era "cannot and will not come back. There is no place for it in today''s China".\r\n\r\n"The decade of calamity caused severe damage, leaving permanent pain for many Chinese," it said, but added that the lessons learned from the era had "given the nation a certain immunity".\r\n\r\n"Nobody fears turmoil, and desires stability more than us," it said\r\n', , '1.jpeg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(9, 'Claudio Ranieri: Leicester boss named manager of the year', '2016-06-07', 'Leicester boss Claudio Ranieri has been named manager of the year by the League Managers'' Association.\r\n\r\nThe 64-year-old Italian was honoured after leading the Foxes to their maiden top-flight title in his first season with the club.\r\n\r\nRanieri also received the Premier League accolade, with Brighton''s Chris Hughton taking the Championship award.\r\n\r\nWigan''s Gary Caldwell and Northampton''s Chris Wilder took the League One and League Two honours respectively.\r\n\r\nRanieri is only the second non-British or Irish manager to win the prestigious accolade after Arsenal''s Arsene Wenger, who won it in both 2002 and 2004.\r\n\r\nThe Leicester boss had already picked up three manager of the month awards in the course of his side''s remarkable campaign, and was named Italian manager of the year in his homeland last month.\r\n\r\nHughton received his award despite his side failing to win their division.\r\n\r\nBrighton finished third in the second tier and were knocked out of the play-offs in the semi-finals on Monday by Sheffield Wednesday.', , '3.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(10, 'Former Delhi Top Cop Kiran Bedi Appointed Puducherry Lieutenant Governor', '2016-06-07', 'Former top cop and senior BJP leader Kiran Bedi has been appointed as the Lieutenant Governor of Puducherry, where the Congress won the assembly elections last week. She replaces Lieutenant-General AK Singh -- who as the Lieutenant Governor of Andaman and Nicobar, was given additional charge of Puducherry in 2014.\n\n"The President of India has been pleased to appoint Ms. Kiran Bedi, to be the Lt. Governor of Puducherry with effect from the date she assumes charges of her office," a communique from President Pranab Mukherjee''s office read.\n\nMs Bedi had joined the BJP in January last year, following which she was projected as the party''s Chief Ministerial candidate in the Delhi assembly elections. But her candidature was cited as one of the reasons why the party lost Delhi to Arvind Kejriwal''s Aam Aadmi Party.\n\n"I am trustworthy in terms of governance. I''m going to live up to that," Ms Bedi told NDTV. "The good news is that it is a union territory, which means one can do so much more."\n\nThe country''s first woman IPS officer who served for 35 years before joining politics, said she had considerable exposure to the office during her stint as the secretary to Delhi''s former Lieutenant Governor Tejinder Khanna in 1998-99. "I handled policing, municipal corporation, grievance redressal," she said.\n\nOn Thursday, the Assembly election results showed the Congress has won 15 of the 30 seats in Puducherry. Its ally DMK won two.\n', , '3.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(11, 'Memory lane', '2016-06-07', 'She understood me like no one else. She made me feel special. I was head over heels in love with my best friend\r\n\r\nay 15, 2016- We were about to meet again, and she was late as usual. It had been eight years since we had last seen each other. And as I waited, I wondered why all of a sudden she had called me up this morning. \r\n\r\nAll those high school memories were still fresh in my head. I had been away from home for the first time and although I was amidst many people, I had still felt alone. But after I met Bhawana, I never felt lonely. She understood and cared for me. She made me feel special. In college I don’t remember talking with anyone besides her. It was obvious for me to fall in love with my best friend. I loved the way she bit her nails when she was upset, her messy evening hair, and her skin, her smile—I loved everything about her. At first, I was scared of my own feelings for her but I could not let go of them. \r\n\r\nOur first few dates as a couple, our first kiss—everything was like a fairy tale come true. But life got in the way. I told Bhawana that our parents wouldn’t permit us to get married. She asked me to ask my parents about us. My parents said that if I was to marry her I would never enter my house again. Bhawana’s parents forced her to choose between me and them. She chose them. I told her that we could both go abroad. No one here has to know about us but life is not a bed of roses. \r\n\r\n“I choose my family.” These words were stuck in my ears for many years. She told me to forget everything. She was getting married to someone else. I had begged her to come and meet me for the very last time. But she never came. I spent the entire day in Basantapur, waiting for her. All those promises we had made in the alleys of Kumaripati were etched in my heart, but they somehow now seemed hollow and fake.\r\n\r\nI again got lost amidst the crowd. This time I had a scar in my heart. That night when I reached home I knew something inside me died. All I remember doing was crying and cursing Bhawana. I wished I had never met her. And today, after all these years, she called.\r\n\r\n“Kabita,” says a voice. She was just standing right behind me. \r\n\r\n“Hello, Kabita. How are you?” \r\n\r\nshe asks. \r\n\r\n“I am good,” I reply. \r\n\r\n“I am sorry that I am late. I was stuck in a jam,” says Bhawana. \r\n\r\nKabita just nods her head. Bhawana continues, “I am hungry. Can we order something?” Kabita replies that she is not hungry, she would prefer just a cup of coffee. \r\n\r\nAfter ordering a coffee and a plate of momos, there is a stillness in the air. Bhawana tries to make conversation: the weather, a new novel by BudhhiSagar, the latest songs—anything to keep the elephant in the room at bay.  \r\n\r\nAfter a few moments of silence, Bhawana says, “I am sorry, Kabita. For every pain I have given to you. Please don’t hate me. \r\n\r\n“I miss you. Honestly, I miss you every single day. I still love you. I know it doesn’t sound right. I am a married woman. I thought that after getting married I would be able to move on. But I couldn’t. It took me this long to gather courage and come see you. I am sorry, Kabita. Can we be together?” \r\n\r\n“Bhawana, all those times I spent with you will always be in my heart. You were family to me. I cannot hate you. I know everything you did was because you had no choice. I respect your decision but I am sorry we cannot be together now. Besides, by talking about these old matters we are not doing any good for us nor our families,” I say.\r\n\r\nBhawana says, “I have spent my entire life trying to make others happy. Now I want my share of happiness.”\r\n\r\n“I understand that, Bhawana. But I cannot be the one to break your family. After you left I was shattered. I was depressed. Then I met him. My psychologist, who helped me in my worst times.  He turned out to be the perfect partner. He knows everything about me, and us. He knows about my sexuality. He taught me to embrace my identity. He held my hands during the darkest moments of my life. And he showed me the way out. He whole heartedly loved and supported me. Now I am the mother of our three-year-old son, Arun. Viren knows that we are meeting here today. After I received your call, I was so confused; I couldn’t decide if I wanted to meet you or not. I would have hated you if it weren’t for him. He helped me see the brighter side. He convinced me that you were forced to choose between me and your parents. You cared about your family more than yourself. This shows that you have a great heart. If there is any other way I can help you, please do tell me. I would be more than happy.”\r\n\r\nBhawana says nothing but stares at the knots of grass on the floor. \r\n\r\n“I am thankful to you, Bhawana for all those wonderful moments we had together.” \r\n\r\n“I am happy that you are happy, Kabita. Stay happy,” says Bhawana.\r\n\r\n“Thank you, Bhawana. Viren has even invited you home. You can come over any time you like. Arun would love you.” \r\n\r\nBhawana replies, “Sure. I would love to come and see your family someday.”\r\n\r\n                                                                                     ***\r\n\r\nFifteen years have since passed. I sit in my garden; going down the familiar memory lane. \r\n\r\nBhawana never called after that. That brief meeting at a small café is all I have now. \r\n\r\n“Mother, Baba says the fire for the barbecue is ready,”  shouts Arun from the balcony excitedly.\r\n\r\n“Coming, son,”  I say, as I dust myself up.', , '2.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(12, 'Old Trafford: Urgent inquiry demanded after bomb ''fiasco''\r\n', '2016-06-06', 'An "urgent" inquiry has been demanded into how a "training device" used in an exercise caused a Premier League match at Old Trafford to be postponed.\r\n\r\nThe match between Manchester United and Bournemouth was called off after the item was discovered close to kick-off.\r\n\r\nA controlled explosion was carried out on the device, which police said was accidentally left by a private firm.\r\n\r\nGreater Manchester Mayor and Police and Crime Commissioner Tony Lloyd called for a full inquiry into the "fiasco".\r\n\r\nBomb disposal experts were called to the 75,000-seat stadium on Sunday after the replica device was found in a toilet.\r\n\r\nThe Premier League match has since been rearranged for Tuesday at 20:00 BST.\r\n\r\nMr Lloyd called the situation "unacceptable" and demanded an urgent inquiry to discover "how this happened, why it happened and who will be held accountable".\r\n\r\nHe added: "This fiasco caused massive inconvenience to supporters who had come from far and wide to watch the match, wasted the time of huge numbers of police officers and the army''s bomb squad, and unnecessarily put people in danger."\r\n\r\nUnited will be refunding all tickets and allowing ticket holders from both clubs in for free on Tuesday night. Manchester United season ticket holders will also be given a credit.\r\n\r\nIt is estimated this gesture will cost United around £3m.\r\n\r\nBournemouth expect to make an announcement on arrangements for their travelling fans on Monday.\r\n\r\nA Greater Manchester Police (GMP) statement read: "Shortly before today''s planned football fixture, staff from the Manchester United ground alerted police to a suspicious item that had been found in the toilets within the North West Quadrant, between the Sir Alex Ferguson stand and the Stretford End.\r\n\r\n"Police quickly attended and explosive experts were called in to assess the item, which has been described as an incredibly realistic-looking explosive device."\r\n\r\nThe Sir Alex Ferguson Stand and the Stretford End were evacuated and sniffer dogs brought in.\r\n\r\nKick-off was delayed initially and shortly afterwards the match was abandoned on police advice.\r\n\r\nA bomb disposal team carried out the explosion at about 16:30 BST.\r\n\r\nAssistant chief constable John O''Hare said: "I am grateful to the Manchester United and Bournemouth supporters for their support and assistance today.\r\n\r\n"Following today''s controlled explosion, we have since found out that the item was a training device which had accidentally been left by a private company following a training exercise involving explosive search dogs.\r\n\r\n"While this item did not turn out to be a viable explosive, on appearance this device was as real as could be, and the decision to evacuate the stadium was the right thing to do, until we could be sure that people were not at risk."\r\n\r\nManchester United''s executive vice-chairman Ed Woodward said: "The club takes security very seriously and staff are regularly trained with the police and emergency services to identify and deal with these incidents.\r\n\r\n"We will investigate the incident to inform future actions and decisions."\r\nJust under two hours before the controlled explosion was carried out, an "operation red code" alert had been heard over the public address system, and the players who were warming up had left the field.\r\n\r\nFans were then advised that, because of "the discovery of a suspect package in the north-west quadrant of the ground, the match has been abandoned for today on police advice".\r\nSupporters who were still in the ground were advised to stay in their seats while the forecourt was cleared of fans who had been in the two stands that were evacuated.\r\n\r\nUnited players were seen leaving the ground shortly after 16:30 BST. BBC commentator Conor McNamara said he saw Bournemouth players and staff boarding their team bus outside Old Trafford around an hour later.\r\n\r\nThe south coast club flew back to Bournemouth on Sunday night.\r\n\r\nManchester United had started Sunday with an outside chance of qualifying for next season''s Champions League by finishing fourth in the Premier League.\r\n\r\nHowever, Manchester City''s draw against Swansea in their final game means United are effectively out of the running. City are three points clear of their neighbouring rivals and possess a goal difference that is 18 better.\r\n\r\nAnalysis\r\n\r\nBy Phil McNulty, BBC Sport chief football writer at Old Trafford:\r\n\r\n"The first indications that all was not well at Old Trafford came when stewards swung into action and fans were evacuated from the Stretford End.\r\n\r\n"Thousands of supporters were already inside the stadium when, in a well-organised drill, supporters in the giant Sir Alex Ferguson Stand were also moved out as a ''Red Code'' operation was announced over the public address system.\r\n\r\n"Those in the Sir Bobby Charlton Stand, where some had already gathered in the directors'' box, and the East Stand, where the Bournemouth supporters were assembled, were told to stay calm and remain in their seats.\r\n\r\n"Bournemouth''s players had started their warm-up but they left the pitch swiftly once it became clear a security operation was under way as police moved in and a helicopter flew above the ground.\r\n\r\n"Some Bournemouth fans were unhappy at the regular announcements to remain in their seats, especially after word had swept around Old Trafford that the game had been called off, but safety was understandably paramount.\r\n\r\n"Once the official announcement was made to those still inside the stadium, there was an orderly exit, although roads around the ground remained cordoned off by police and stewards as fans were shepherded away from the area where police were carrying out an inspection of the suspect package."\r\n', , '4.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(13, 'PM Modi Goes To Iran Today, Chabahar Port High On Agenda: 10 Points', '2016-06-08', 'Here are the top 10 developments in this big story:\nPM Modi will land in Teheran airport this evening. Later, he will meet a delegation of Sikhs residing in Iran and visit a local Gurdwara.\nDuring the visit he will engage with the Iranian top leadership including President Hassan Rouhani to boost trade, energy and strategic ties. He will also meet Iran''s supreme religious and political leader Ayatollah Khamenei.  \nThe centerpiece of the Prime Minister''s visit will be the signing of a trilateral agreement on Chabahar -- a strategic port in the Gulf of Oman on Iran''s southern coast with Afghanistan. India will help develop the port.\nIn the first phase India plans to invest around $200 million to develop terminals and cargo berths at Chabahar. In the next phase, India plans to build a 500-km railway line between Chabahar and Zahedan.\nAhead of PM Modi''s visit, India has cleared part of its $6.4 billion oil dues to Iran. Discussions will be held on the modalities of payment for the rest.\nThe bilateral talks will also feature Indian firms securing rights to develop the offshore Farzad-B gas field, which was discovered by ONGC Videsh.\nDuring PM Modi''s visit, Afghanistan and Iran will sign an agreement to set up a trade and transport corridor with Chabahar as the hub. With this, landlocked Afghanistan will get access to the Iranian port as an alternate to the Pakistani port of Karachi.\nChabahar will provide India another route to into Afghanistan - with which it has developed close diplomatic and strategic ties -- and through it, to central Asian countries.\nCurrently, India does not have access to Afghanistan on a land route due to opposition from Pakistan, which sees India''s expansive diplomacy in the region as a threat.\nIndia''s move is also being seen as a balance to China''s influence in Pakistan. Chabahar is 100 km from Pakistan''s Gwadar port, which China is developing. The Chinese project comes on the heels of its investments in Sri Lanka, Bangladesh and the Maldives.', , '1.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(15, 'Run barefoot to boost your memory\r\n', '2016-06-08', 'Running barefoot is better than running with shoes for your working memory which refers to our ability to recall and process information, according to a study.\r\n\r\nWorking memory is used throughout our lifespan. By improving it, we may be able to realise gains in key areas, from school to work to retirement.\r\n\r\n"Working memory is increasingly recognised as a crucial cognitive skill, and these findings are great news for people looking for a fun way to boost their working memory," said one of the researchers, Tracy Alloway, from the University of North Florida in the US.\r\n\r\nThe researchers enlisted 72 participants between the ages of 18 and 44, who ran both barefoot and with shoes on at a comfortable, self-selected pace for approximately 16 minutes.\r\n\r\nWorking memory was measured before and after running.\r\n\r\nThe results of this research, published in the journal Perceptual and Motor Skills, found a significant increase -- approximately 16 percent -- in working memory performance in the barefoot-running condition.\r\n\r\nThere was no significant increase in working memory when running with shoes.\r\n\r\n"If we take off our shoes and go for a run, we can finish smarter than when we started," Ross Alloway, who is also from University of North Florida, said.\r\n\r\nWhen running barefoot, one often has to avoid stepping on potentially hurtful objects by using precise foot placement.\r\n\r\nIt is possible that the barefoot condition required a more intensive use of working memory because of the extra tactile and proprioceptive demands associated with barefoot running, which may account for the working memory gains, Ross Alloway explained.', , '1.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(16, 'South Korean novelist Han wins Man Booker International Prize', '2016-06-06', 'South Korean author Han Kang won the Man Booker International Prize for fiction on Monday for her novel "The Vegetarian", a dark, surreal story about a woman who gives up eating meat and seeks to become a tree.\r\n\r\nThe 45-year-old Han had been short-listed for the prize for fiction in translation to English along with Italian writer Elena Ferrante, Angola''s Jose Eduardo Agualusa, Chinese author Yan Lianke, Turkey''s Orhan Pamuk and Austrian Robert Seethaler.\r\n\r\n"This compact, exquisite and disturbing book will linger long in the minds, and maybe the dreams, of its readers," Boyd Tonkin, chairman of the 2016 judging panel, was cited by the foundation as saying.\r\n\r\nThe novel was translated by Deborah Smith, a 28-year-old Briton who only began learning Korean when she was 21.\r\n\r\nHan and Smith will split the 50,000 pound ($72,000) prize equally, according to the Booker Foundation, which administers the prize as well as the original Man Booker Prize for works in English and published in the United Kingdom, a prestigious award that typically leads to a surge in sales for its winner.\r\n\r\nIn "The Vegetarian", after struggling with gruesome recurring nightmares, Yeong-hye, a dutiful wife, rebels against societal norms, forsaking meat and stirring concern among her family that she is mentally ill.\r\n\r\nHan, who was born in the South Korean city of Gwangju, teaches creative writing at the Seoul Institute of the Arts. "The Vegetarian" is her first novel translated into English.\r\n\r\nThe Man Booker International Prize was previously awarded every two years for an author''s overall contribution to global fiction, but beginning with this year''s prize it is awarded annually for a single work of fiction translated into English and published in the United Kingdom.\r\n\r\n($1 = 0.6941 pounds)', , '4.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(17, 'Syrian rebels fear assault on besieged Daraya as residents starve', '2016-06-07', 'Rebel fighters and officials in a besieged Syrian town on the outskirts of Damascus believe government forces are preparing an assault after they turned back an aid convoy last week.\r\n\r\nDaraya, situated close to a large air base and just a few kilometers (miles) from President Bashar al-Assad''s palace, had seen little violence since a broader cessation of hostilities agreement came into effect at the end of February.\r\n\r\nBut, with the truce rapidly unraveling across Syria, government forces began shelling the town on Thursday after refusing entry to the first aid convoy it would have ever received.\r\n\r\nKnown for its peaceful protests in the early days of the uprising against Assad, Daraya has been besieged and regularly bombed since 2012.\r\n\r\n"Large convoys of (government) troops are moving from the airport and from Ashrafiyat Sahnaya (the next town south)," said Abu Samer, spokesman for the Liwa Shuhada al-Islam rebel group.\r\n\r\n"We are prepared to repel their assault but our main fear is for the civilians besieged in the town who face severe shortages of food."\r\n\r\nA Syrian military source denied rebel accounts of troop deployments, saying nothing had changed in the area.\r\n\r\nDespite there being only around 8,000 residents and about 1,000 fighters left in the town, the Syrian army has not been able to establish control of the area.\r\n\r\n"Our monitoring showed there were heavy vehicle deployments on the southern edge of the city," said Liwa Shuhada al-Islam head Colonel Said Naqrash.\r\n\r\n"The regime is continuing to pour in more equipment, fighters... All these movements indicate that the regime is planning something."\r\n\r\nDaraya is controlled by two main rebel groups, Liwa Shuhada al Islam and Itihad al-Islami Ajnad al-Sham, drawn from local residents. Radical Islamist fighters are not believed to be among them.\r\n\r\n"The Free Syrian Army is abiding by the ceasefire and only repelling attacks," said Daraya activist Fadi Dirani.\r\n\r\nAbu Yamen, a member of the town council, said such concentrations of troops had not been seen since before the truce.\r\n\r\nBURNT CROPS\r\n\r\nThe United Nations said this month that Syria''s government was refusing U.N. demands to deliver aid to hundreds of thousands of people.\r\n\r\nThey include the residents of Daraya, where the struggle for survival has become even more desperate since government forces cut its link with neighboring rebel-held Mouadamiya about six months ago.\r\n\r\n"The army has burnt the wheat and barley," Naqrash said.\r\n\r\nIn April, a group called Women of Daraya wrote an open letter saying the town was on the verge of starvation, with people cooking "soups made purely of spices in order to stave off hunger."\r\n\r\nThe aid convoy blocked last week would have been the first delivered since the siege began.\r\n\r\nBut even then it was not allowed to contain food, only medical and other aid, and residents launched an online campaign ahead of the expected delivery with the slogan: "We cannot eat medicine".\r\n\r\nThe Syrian Observatory for Human Rights said clashes broke out around the besieged town and government forces started shelling after the convoy was turned back.\r\n\r\nDaraya''s local council said on its Facebook page on Saturday it was "extremely worried" about a new military offensive, having seen reconnaissance aircraft overhead and troops gathering south of the town.\r\n', , '2.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(18, 'Trump Supporter Calls Sikh Councillor In US ''Terrorist''. He Hits Back', '2016-06-06', ' In his monthly radio address Mann ki Baat, Prime Minister Narendra Modi congratulated Sarbananda Sonowal, the Chief Minister designate of Assam, but in his capacity as the Union sports minister. Mr Sonowal, who will take oath on May 24, has quit PM Modi''s cabinet.\r\n\r\nPM Modi said he was pleased with the way Mr Sonowal did not neglect his duties as the sports minister even while the assembly elections in Assam was on.\r\n\r\nMr Sonowal, he said, had paid a surprise visit to Patiala''s National Institute of sports in the middle of the election season.\r\n\r\n"There were polls, he was a chief minister candidate but Sarbanand Sonowal performed his duty as a sports minister. This is a big thing," PM Modi said. "Everybody was surprised and noted how a Union Minister showed so much concern."\r\n\r\nThe BJP has won the recently held elections in Assam - a huge victory, since it was the party''s first in a north-eastern state. Mr Sonowal, who is from the state, had led the campaign. At the time, the 53-year-old had been the minister for sports and youth welfare in the Union Government.\r\n\r\nPM Modi said it was important to create the correct atmosphere to encourage athletes before the nation thought about the medal tally in the Olympics.\r\n\r\n"When we talk about the Olympics we do feel sad at the medal tally. But we need to create the right atmosphere to encourage athletes," he said. "It is essential to be positive about our athletes. Let us ot worry about the results."\r\n\r\nIn this context, he spoke of academic results also, referring to a letter written to him by a student named Gaurav.\r\n\r\nThe student from Madhya Pradesh had written to say that he had scored 89% but his family was not satisfied with his results, since they wished him to score 90%.\r\n\r\n"Gaurav, I have read your letter and I am sure there are many like you out there," PM Modi said. Appealing to parents to encourage their wards, he said it was important to feel positivity. \r\n', , '6.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(19, 'U.S., Russia stalemate on Syria frustrates European powers', '2016-06-07', 'The Obama administration''s failure to convince Moscow that Syrian President Bashar al-Assad must go is fuelling European frustration at being sidelined in efforts to end the country''s five-year civil war, diplomats say.Some diplomats and analysts question whether the United States has misread Russia''s desire to keep Assad in power.\r\n\r\n"Many have consistently underestimated Russia''s determination to prevent this regime from falling," said Philip Gordon, a former National Security Council aide to U.S. President Barack Obama. "They''ve been pretty clear that they''re not prepared to let this happen."\r\n\r\nAhead of a meeting on Tuesday of the 17-nation group backing Syria peace talks in Vienna, a senior U.N. diplomat, speaking on condition of anonymity, said that Europeans "tend to be pretty sceptical about the U.S.-Russia bilateralism."\r\n\r\nHe said there were creative ways to provide for a transition away from Assad to give Syrian opposition groups a reason to stop fighting and start negotiating.\r\n\r\n"But we haven''t got anywhere near having that discussion with the Syrians themselves because the U.S. and Russia have been trying to bridge the gap, and they haven''t been able to do so," said the diplomat. "So that''s why we have got to come back and multilateralize this."\r\n\r\nWhile some acknowledge that U.S.-Russian cooperation has delivered a patchwork of partial ceasefires and U.N. Security Council resolutions, the divide over Assad has proven too big to bridge and stalled U.N.-led efforts to negotiate peace agreement.\r\n\r\n"If we recall how (U.S. Secretary of State John) Kerry committed himself on this... it was with the hope and conviction that the Russians would relatively quickly get some commitments from the regime to engage in a political process. This never happened," said a senior Western diplomat, speaking on condition of anonymity to discuss the political differences.\r\n\r\nAs a result, prospects remain bleak for an early end to a conflict that began in 2011 and now has claimed more than 250,000 lives.\r\n\r\nOne of the main problems, diplomats say, is the U.S. administration''s inability - or unwillingness - to confront an increasingly aggressive Russia. Some have suggested Washington lost whatever leverage on Moscow it might have had by failing to follow through on Obama''s 2013 threat to punish Syria for its alleged use of chemical weapons.\r\n\r\n"I''m realistic. I see Americans who aren''t especially combative or ready to put much on the table that would convince the opposition to return to negotiations," said a senior European diplomat in Vienna.\r\n\r\nSome Syrian opposition representatives, Arab and U.N. officials have complained that the United States often has put more pressure on the rebels to compromise instead of pushing Russia to sway the Syrian government.\r\n\r\nSaudi Arabia''s Foreign Minister Adel al-Jubeir signalled that Riyadh is not pinning its hopes on the United States convincing Russia to remove Assad and suggested a push to make sure opposition fighters were better armed might be needed.\r\n\r\n"The choice is Bashar al-Assad''s," he told reporters in Paris last week. "He will be removed, either through a political process or through military force."', , '3.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(20, 'United claim FA Cup with extra-time win over Crystal Palace', '2016-06-06', ' Manchester United substitute Jesse Lingard''s superb volley in extra time secured a 2-1 win over Crystal Palace in the FA Cup final at Wembley Stadium on Saturday for their first major trophy in three years.\r\n\r\nHowever, their Dutch manager Louis van Gaal was left wondering whether it would be enough to preserve his job two seasons into a three-year contract amid British media reports that Jose Mourinho would be offered the job next week.\r\n\r\nThe game was locked at 1-1 after 90 minutes, Jason Puncheon coming off the bench to put London side Palace ahead 12 minutes from time before Juan Mata equalised three minutes later.\r\n\r\nUnited central defender Chris Smalling was sent off in the extra period for a second yellow card but Lingard''s moment of class gave them the Cup for the first time since 2004.\r\n\r\n"It''s fantastic to win this title for the club, the fans and also for me," Van Gaal said. "Now I have won a Cup in four countries. Not many managers can say that so I am very happy.\r\n\r\n"I don''t want to talk about leaving the club."\r\n\r\nBRILLIANT RUN\r\n\r\nUnderdogs Palace took the lead when Puncheon, who had only come on six minutes earlier, deftly controlled a long ball into the area and fired past United goalkeeper David de Gea.\r\n\r\nBut within three minutes Wayne Rooney went on a brilliant run across the edge of the Palace area and crossed for Marouane Fellaini to set up the equaliser for Spaniard Mata.\r\n\r\nDespite playing the second period of extra time with 10 men after Smalling''s dismissal, United poured forward and Lingard''s goal secured a 12th FA Cup triumph, equalling Arsenal''s record.\r\n\r\n"I saw it come across and it landed nicely for me, all I had to do was hit it sweet and luckily I did that. As a sub you always have to be ready. Thankfully I was," Lingard said.\r\n\r\nVan Gaal, who arrived for his news conference carrying the trophy, added: "It was a super goal when we needed it.\r\n\r\n"It was unbelievable that we had injuries again but in spite of going down to 10 players we showed the spirit we have shown on the road to the final."\r\n\r\nPalace manager Alan Pardew, who played when the London club lost the replayed 1990 final against United, was frustrated by two refereeing decisions from Mark Clattenburg, who will be in charge of next weekend''s Champions League final.\r\n\r\nHe felt Wilfried Zaha should have had a penalty when tackled by Rooney and that play should have been waved on as Connor Wickham recovered from Smalling''s challenge and scored.\r\n\r\n"It was a great cup final and could have gone either way," Pardew told reporters.\r\n\r\nUNITED DANGEROUS\r\n\r\nPalace did not get quite enough from speedy winger Zaha, who United once bought for 15 million pounds ($21.76 million) before selling him back to their opponents, and Yannick Bolasie.\r\n\r\nThe London side threatened mainly from set pieces, although the tall Fellaini was a valuable asset in defending them.\r\n\r\nUnited made the more dangerous chances throughout the game, hitting the post twice early in the second half through Fellaini and young French striker Anthony Martial.\r\n\r\nRooney was an influential captain in his deeper midfield role and 18 year-old Marcus Rashford made several of their best opportunities, but had to go off injured in the 72nd minute.\r\n\r\nVan Gaal could not say how serious the injury was or whether it would prevent Rashford joining the England squad next week.\r\n\r\nIt was the second time United had won the FA Cup after having a player sent off. Irish defender Kevin Moran was the first man dismissed in a final, when they beat Everton in 1985. Smalling was the fourth and the first Englishman.\r\n\r\nThere was a bonus in Palace''s defeat for West Ham United, who will join United in the Europa League next season after the east London side move into their new Olympic Stadium ground.\r\n\r\n($1 = 0.6894 pounds)', , '5.jpg');
INSERT INTO `article` (`id`, `title`, `date`, `article`, `image`, `img_name`) VALUES
(21, '‘Nobody can do everything, everyone can do something’', '2016-06-07', 'UN Deputy Secretary General Jan Eliasson was in Nepal for a three-day visit to observe post-disaster reconstruction and rally support for Nepal in the run-up to the World Humanitarian Summit to be held in Turkey later this month. Eliasson spoke to the Post. Excerpts:\r\n\r\nCan you tell us the purpose of your visit to Nepal?\r\n\r\nOf course, the main reason is the horrific disaster that struck your country and the people last year. It was a shock to the whole world. We at the United Nations wanted very much to be helpful—as much as possible. We know basically it will depend on national efforts but we want to show international solidarity and engagement with you. \r\n\r\nAt the same time, we’re planning for the World Humanitarian Summit which will take place in Istanbul, Turkey. Together with my colleagues in New York and the Secretary General, we decided that I would go to Nepal and prepare for the Istanbul meeting on natural disasters. I will myself also go to the meeting. So, this visit was in a way preparation. I spent three days discussing the result, response to the disaster, the degree to which one can be better prepared for next time, the degree to which one can ‘build back better’, the different measures that can be taken in different areas, from building standards to socio-economic measures. \r\n\r\nDuring your trips to Sindhupalchok and Bungamati, you got to see first-hand how earthquake survivors are living and how reconstruction works are going on. How did you find the recovery process going on?\r\n\r\nIn the 90s, I saw the cyclone in Bangladesh that drowned 190,000 people in 45 minutes. I witnessed the earthquake in Armenia, I followed the Haiti operation from the Swedish perspective, and I know its huge challenge. Having said this, I think there is the need to see an event of this nature as a huge challenge to any society, a huge opportunity to mobilise the whole spectrum of national and international actors.\r\n\r\n I say nobody can do everything; everybody can do something. But I am very proud to say that cooperation between UN agencies and the government, at least the district activities, is very good. And we hope that we will be able to move as rapidly as possible. \r\n\r\nHow do you assess the role of UN when Nepal is recovering from the Gorkha Earthquake?\r\n\r\nWe are perhaps the most important international partner. We are not only United Nations as the sum of the agencies, but we are also linked to the 192 member states. And, of course, there was the donor conference that brought the pledges to the fore, but I think it is important that we move to the stage of translating the pledges into programmes. There is increased focus on preparing the projects so that we can pass them to member states and also to the World Bank, the IMF and regional banks—for all those willing to help out. Because these projects are not only humanitarian actions, they are also development.\r\n\r\nAs you said, this visit was in preparation for the World Humanitarian Summit. What were the lessons the UN learnt from the earthquakes that struck Nepal last year. What was the UN experience?\r\n\r\nWell, the same experience that we experienced practically in every natural disaster: to react rapidly and in a coordinated fashion. But in Nepal, you’ve huge problems of geography, lack of transportation facilities. But also there is a need in a situation like this to rather immediately set up a coordination mechanism and move together. And, it is surprising, in how many areas you need to have that coordination—in logistical terms, in terms of delivering humanitarian assistance, you have to the deal with shelter needs but you also need to have the political support. You need to have as broad a political support as possible for these operations. And, I would want to see this as a huge problem of course, but also as a huge opportunity. You have a historical task now to set the stage for better future by ‘building back better’, by mobilising everybody around a common goal and look more long term than short term.\r\n\r\nGiven the slow progress in reconstruction works in Nepal one year after the quake, how much is the UN committed to reconstruction works in the long term?\r\n\r\nWe are committed to short-term, medium-term and long-term. We have almost 2,000 people working in Nepal—most of them Nepalis. We have mobilised young people, we’re very proud to see UN volunteers who’re joining the efforts. And, we see this as a very important mission and we also want to send a message to the World Humanitarian Summit that we should have better preparedness for natural disasters. I know from experience that you can improve the preventive measures, build resilience even in natural disaster situations. \r\n\r\nThere is so much one can do to prepare the ground by building standards, but also go stronger into the economic and social processes and learn that it is often the poorest people who are paying the higher price. So we will be there at your side and my visit is meant to send the signal to Nepal and the Nepali people that we are there to help.\r\n\r\nUN has been one of Nepal’s oldest development partners. It is obvious that, after the earthquake, one major area of UN engagement will be post-earthquake rebuilding. But Nepal has also been planning to graduate into a middle income country. What would be the UN support for this?\r\n\r\nNepal has been so successful in achieving several of the millennium development goals. I have been very much involved in the negotiation for Sustainable Development Goals (SDGs), which is a new set of goals. I had a meeting with the vice-chairman of National Planning Commission, where I was briefed about integrating these 17 SDG goals into national planning. These are not only related to development assistance but also to change we have to make in our society to make it more sustainable.', , '3.jpg');

